import React, { useState } from 'react';

// In src/components/Community.jsx

const communitySpaces = [
    { id: 'gratitude', name: 'Daily Gratitude', icon: 'üå∏', description: 'Share what you\'re thankful for.' },
    { id: 'success', name: 'Success Stories', icon: 'üèÜ', description: 'Share your mental health wins, big or small.' },
    { id: 'vent', name: 'Vent Anonymously', icon: 'üòî', description: 'A safe, anonymous space to let it all out.' },
    { id: 'mindfulness', name: 'Mindfulness Tips', icon: 'üß†', description: 'Share techniques that work for you.' },
    { id: 'career', name: 'Career & Workplace', icon: 'üíº', description: 'Discuss work stress and career challenges.'},
    { id: 'relationships', name: 'Relationship Advice', icon: 'üíû', description: 'Talk about relationships with friends, family, and partners.'},
    { id: 'creative', name: 'Creative Corner', icon: 'üé®', description: 'Share your art, poetry, and music.'},
    { id: 'beginners', name: 'New to MoodMate', icon: 'üëã', description: 'A welcoming space for new members.'}
];

const samplePosts = {
    gratitude: [
        { id: 1, user: 'Priya', text: 'Grateful for the warm sun today!', likes: 12 },
        { id: 101, user: 'Amit', text: 'Thankful for a good conversation with an old friend.', likes: 8 },
    ],
    success: [
        { id: 2, user: 'Rohan', text: 'I finally finished my project without feeling overwhelmed!', likes: 25 },
        { id: 102, user: 'Sonia', text: 'Managed to meditate for 10 minutes straight today!', likes: 19 },
    ],
    vent: [
        { id: 3, user: 'Anonymous', text: 'Exams are so stressful right now, I feel like I can\'t keep up.', likes: 45 },
        { id: 103, user: 'Anonymous', text: 'Feeling really lonely today, even in a crowd.', likes: 33 },
    ],
    mindfulness: [
        { id: 4, user: 'Aisha', text: 'Tried box breathing today, it really helped calm me down before my meeting.', likes: 18 },
        { id: 104, user: 'Vikram', text: 'Has anyone tried the 5-4-3-2-1 grounding technique? It works wonders for me.', likes: 22 },
    ],
    career: [{id: 105, user: 'Neha', text: 'My boss is really piling on the pressure this week. How do you all cope?', likes: 15 }],
    relationships: [{id: 106, user: 'Anonymous', text: 'How do you tell a friend you need some space without hurting their feelings?', likes: 28 }],
    creative: [{id: 107, user: 'Leo', text: 'Sharing a small poem I wrote about hope. Let me know what you think!', likes: 11 }],
    beginners: [{id: 108, user: 'Sam', text: 'Hi everyone! Just joined. A little nervous but excited to be here.', likes: 50 }],
};
 
function Community({ user }) {
    const [activeSpace, setActiveSpace] = useState(communitySpaces[0]);
    const [posts, setPosts] = useState(samplePosts[activeSpace.id]);

    const selectSpace = (space) => {
        setActiveSpace(space);
        setPosts(samplePosts[space.id] || []);
    };

    return (
        <div className="tab-content community-hub">
            <div className="community-sidebar">
                <h3>Community Spaces</h3>
                {communitySpaces.map(space => (
                    <button 
                        key={space.id} 
                        className={`space-btn ${activeSpace.id === space.id ? 'active' : ''}`}
                        onClick={() => selectSpace(space)}
                    >
                        <span className="space-icon">{space.icon}</span>
                        {space.name}
                    </button>
                ))}
            </div>
            <div className="community-feed">
                <div className="feed-header">
                    <h2>{activeSpace.icon} {activeSpace.name}</h2>
                    <p>{activeSpace.description}</p>
                    <button className="create-post-btn">+ Create Post</button>
                </div>
                <div className="post-list">
                    {posts.map(post => (
                        <div key={post.id} className="post-card">
                            <div className="post-header">
                                <div className="post-avatar">{post.user.charAt(0)}</div>
                                <span className="post-username">{post.user}</span>
                            </div>
                            <p className="post-text">{post.text}</p>
                            <div className="post-actions">
                                <button className="like-btn">‚ù§Ô∏è {post.likes}</button>
                                <button className="comment-btn">üí¨ Comment</button>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
}

export default Community;
